import React from 'react'

function UCB() {
    return (
        <div>
            <h1>UCB</h1>
            <p> Benetton Group S.r.l. (Italian pronunciation: [benetËˆton][1]) is a global fashion brand based in Ponzano Veneto, Italy founded in 1965. Benetton Group has a network of about 5,000 stores worldwide.[2] It is a wholly owned subsidiary of the Benetton family's holding company Edizione.</p>
        </div>
    )
}

export default UCB
